import "./App.css";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import CardsCompiler from "./components/RecipeCard/CardsCompiler";
import { useDispatch } from "react-redux";
import { getRecipes, allRecipes } from "./redux/actions";
// import { recipe } from "./components/db/db";
import { useState } from "react";

function App() {
  const dispatch = useDispatch();
  const recipe = dispatch(allRecipes("id", "DESC"));

  const [recipeState, setRecipe] = useState([]);

  recipe.then((response) => setRecipe(response));
  console.log(recipeState);

  return (
    <div className="App">
      <h1>Henry Food</h1>
      <input type="text" placeholder="Search..." className="search" />
      <CardsCompiler recipe={recipeState} />
    </div>
  );
}

export default App;
